          <h3 className="question">{props.question}</h3>
          <div className="answers">
            <div className="answer--selector selected">Mercury</div>
            <div className="answer--selector selected">Cabbage Patch Kids</div>
            <div className="answer--selector selected">Transformers</div>
            <div className="answer--selector selected">Italy</div>
          </div>
        </div>
      </div>
      <button className="btn--check--answer">Check answer</button>
    </div>
  );
}
